import React from 'react';
import {BrowserRouter, Route, NavLink} from 'react-router-dom';

class LoginForm extends React.Component {



	render(){
	return(
		<BrowserRouter>
	<div className='AvatarDiv'>
      <h3>Авторизація</h3>
      <div>
      <div>Email</div>
      <input id="email" placeholder="Ваш Email.." type="text"/>
      </div>
      <div>
      <div>Password</div>
      <input id="password" placeholder="Ваш пароль.." type="text"/>
      </div>
      <button style={{margin: '10px'}} onClick={this.login}>Увійти</button>
      <NavLink to='/signup'><button style={{margin: '10px'}}>Зареєструватися</button></NavLink>
      </div>
      <Route path='/signup' exact component={Signup} />
      </BrowserRouter>)
	}
}

export default LoginForm;
